import { FcDeleteDatabase } from "react-icons/fc"

const CartItem = ({ item }) => {
  return (
    <div>
      <div>

        <div>
          <img src={item.image} alt="" />
        </div>

        <div>
          <h1>{item.title}</h1>
          <h2>{item.description}</h2>
          <div>
            <p>{item.price}</p>
            <div onClick={remove}>
              <FcDeleteDatabase />
            </div>
          </div>

        </div>

      </div>
    </div>
  );
};

export default CartItem;
